import { useState } from "react";
import { Link } from "react-router-dom";

const PatientLogin = ()=>{

    const [userName, setUserName] = useState("");
    const [password, setPassword] = useState("");

    const ResetField = ()=>{
        setUserName("");
        setPassword("");
    }
    
    function onLoginClick(event){
        event.preventDefault();
        const formData = {
            Email : userName ,
            Password : password
        }
        
        console.log(formData)
        
        setUserName("");
        setPassword("");
        
    }
    

    return(
        <div>
            <p>
            <Link to="/doctorlogin">Doctor Login Here</Link>
            </p>
            <h4 className="opacity-75">Patient Login</h4>
            <form className="col-sm-30">
                <p className="opacity-50">Patient Email ID</p>
                <input className="form-control" type="Email" value={userName} placeholder="Enter Email ID" /><br/>
                <p className="opacity-50">Patient Password</p>
                <input className="form-control" type="password" value={password} placeholder="Enter Password" /><br/>
                <div>
                    <button type="Submit" onClick={onLoginClick} className="btn btn-success">SUBMIT</button>
                    <button type="Submit" onClick={ResetField} className="btn btn-secondary ">
                        Reset
                    </button>
                </div> 
                                              
            </form> 
            <br/>
            <Link to="/patientRegistration">New Patient ? Reg. Here</Link>
                 
        </div>
    );
}

export default PatientLogin;
